import React from "react";
import TwitterIcon from "@material-ui/icons/Twitter";
import FacebookIcon from "@material-ui/icons/Facebook";
import InstagramIcon from "@material-ui/icons/Instagram";
import EmailIcon from "@material-ui/icons/Email";
import LinkedInIcon from "@material-ui/icons/LinkedIn";
import CallIcon from "@material-ui/icons/Call";
import LocationOnIcon from "@material-ui/icons/LocationOn";
import { Grid } from "@material-ui/core";

function Footer() {
  return (
    <div
      style={{
        marginTop: "15%",
        height: "400px",
        width: "100%",
        backgroundColor: "#006666",
        color: "whitesmoke",
      }}
    >
      <Grid
        container
        justify="center"
        style={{ marginTop: "12rem", color: "whitesmoke" }}
      >
        <TwitterIcon
          style={{ fontSize: "50px", marginRight: "4rem" }}
        ></TwitterIcon>
        <FacebookIcon
          style={{ fontSize: "50px", marginRight: "4rem" }}
        ></FacebookIcon>
        <InstagramIcon
          style={{ fontSize: "50px", marginRight: "4rem" }}
        ></InstagramIcon>
        <EmailIcon
          style={{ fontSize: "50px", marginRight: "4rem" }}
        ></EmailIcon>
        <LinkedInIcon
          style={{ fontSize: "50px", marginRight: "4rem" }}
        ></LinkedInIcon>
      </Grid>
      <br />
      <h1 style={{ textAlign: "center" }}>We're based in Yerevan, Armenia</h1>
      <h3 style={{ textAlign: "center" }}>
        We want hamakargel , all bus transport in Yerevan
      </h3>
      <Grid container style={{ marginLeft: "50vh", marginTop: "100px" }}>
        <CallIcon
          style={{ marginRight: "0.5rem", fontSize: "25px" }}
        ></CallIcon>
        <text style={{ marginRight: "3rem" }}>asbdianbkxani</text>
        <LocationOnIcon style={{ marginRight: "1rem" }}></LocationOnIcon>
        <text style={{ marginRight: "3rem" }}>asndkjasncnakcnkjask</text>
        <EmailIcon style={{ marginRight: "1rem" }}></EmailIcon>
        <text style={{ marginRight: "3rem" }}>asnjkan as @asdkjas </text>
      </Grid>
      <div
        style={{
          textAlign: "center",
          fontSize: "20px",
          color: "white",
          marginTop: "3rem",
        }}
      >
        &copy; Code Republic 2021
      </div>
    </div>
  );
}

export default Footer;
